import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';

const Todo = (props) => {
  return (
    <>
    <div className='flex justify-between'>
        <div>
            <p>{props.desc}</p>
        </div>
        <button>
    <DeleteIcon/>
        </button>
    </div>
    </>
  )
}

export default Todo
